import { useMemo, useState } from "react";
import { useTable } from "react-table/dist/react-table.development";
import "./ResultBoxes.css";

import reactTable from "react-table";
const INITIAL_VALUES = [
  {
    random0: {
      timeStamp: "2018-04-17T19:16:00",
      volume: 10,
      price: 20,
    },
    random1: {
      timeStamp: "2018-04-18T19:16:00",
      volume: 90,
      price: 100,
    },
  },
];

const columnData = [
  {
    accessor: "timestamp",
    Header: "timestamp",
  },
  {
    accessor: "volume",
    Header: "volume",
  },
  {
    accessor: "price",
    Header: "price",
  },
];

function WaitBuyBox({ initialValues = INITIAL_VALUES, columnData }) {
  const columns = useMemo(() => columnData, []);
  const [data, setData] = useState([{ initialValues }]);
  const dataTest = useMemo(() => data, []);

  const [info, setInfo] = useState();
  const { getTableProps, getTableBodyProps, headerGroups, rows, prepareRow } =
    useTable({ columns, data });

  // const getWaitBuy = () => {
  //   dataTest.getWaitBuy().then(item => setInfo(item))
  // }
  // const dataTest = useMemo(() => info, [info])
  return (
    <div className="ResultBox">
      <h1 className="ResultBox-heading">미체결(Buy)</h1>
      <table {...getTableProps()}>
        <head>
          {headerGroups.map((headerGroup) => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map((column) => (
                <th {...column.getHeaderProps()}> {column.render("Header")}</th>
              ))}
            </tr>
          ))}
        </head>
      </table>
    </div>
  );
}

export default WaitBuyBox;
